import { useLocation, useParams } from 'react-router-dom';

function Detail() {
    const Location = useLocation().pathname;

    let saveId = []

    while(1){
        if(Location[-1] == '/'){
            break;
        }
        saveId.unshift(Location.pop())
    }
    console.log(saveId)
    

    return(
        <>
       <p1>{Location}</p1>
       </>
        );
    }
export default Detail;
